--changeset mamonroy:01
--comment: CCP1_OCT2019 [39][40][56][57][58][60][61][62]
UPDATE validacionProceso
SET vapValidacion = 'VALIDACION_PERSONA_FALLECIDA_PRESENCIAL'
WHERE vapValidacion = 'VALIDACION_PERSONA_FALLECIDA'
AND vapProceso IN ('NOVEDADES_PERSONAS_PRESENCIAL','NOVEDADES_PERSONAS_WEB','NOVEDADES_DEPENDIENTE_WEB');

DELETE FROM ValidacionProceso
WHERE vapBloque IN ('NOVEDAD_CAMBIO_TIPO_NUMERO_DOCUMENTO_PERSONAS')
AND vapValidacion = 'VALIDACION_TIPO_DOCUMENTO_TARJETA_IDENTIDAD'
AND vapProceso = 'NOVEDADES_PERSONAS_PRESENCIAL';

DELETE FROM ValidacionProceso
WHERE vapBloque IN ('CAMBIAR_MEDIO_DE_PAGO_DEPENDIENTE_PRESENCIAL','CAMBIAR_MEDIO_DE_PAGO_DEPENDIENTE_WEB','CAMBIAR_MEDIO_DE_PAGO_DEPENDIENTE_DEPWEB')
AND vapValidacion IN ('VALIDACION_PERSONA_CONYUGE_ACTIVO','VALIDACION_PERSONA_PENSIONADO_ACTIVO','VALIDACION_PERSONA_INDEPENDIENTE_ACTIVO')
AND vapObjetoValidacion = 'TRABAJADOR_DEPENDIENTE';

DELETE FROM ValidacionProceso
WHERE vapBloque IN ('CAMBIAR_MEDIO_DE_PAGO_ADMINISTRADOR_DE_SUBSIDIO_PRESENCIAL','CAMBIAR_MEDIO_DE_PAGO_ADMINISTRADOR_DE_SUBSIDIO_WEB','CAMBIAR_MEDIO_DE_PAGO_ADMINISTRADOR_DE_SUBSIDIO_DEPWEB')
AND vapValidacion IN ('VALIDACION_PERSONA_CONYUGE_ACTIVO','VALIDACION_PERSONA_PENSIONADO_ACTIVO','VALIDACION_PERSONA_INDEPENDIENTE_ACTIVO')
AND vapObjetoValidacion = 'TRABAJADOR_DEPENDIENTE';

DELETE FROM ValidacionProceso
WHERE vapBloque IN ('CAMBIO_ADMINISTRADOR_DEL_SUBSIDIO_MONETARIO_TRABAJADOR_DEPENDIENTE','CAMBIO_ADMINISTRADOR_DEL_SUBSIDIO_MONETARIO_TRABAJADOR_DEPENDIENTE_WEB')
AND vapValidacion IN ('VALIDACION_PERSONA_CONYUGE_ACTIVO','VALIDACION_PERSONA_PENSIONADO_ACTIVO','VALIDACION_PERSONA_INDEPENDIENTE_ACTIVO')
AND vapObjetoValidacion = 'TRABAJADOR_DEPENDIENTE';

DELETE FROM ValidacionProceso
WHERE vapBloque IN ('CAMBIO_ADMINISTRADOR_DEL_SUBSIDIO_MONETARIO_ADMINISTRADOR_SUBSIDIO','CAMBIO_ADMINISTRADOR_DEL_SUBSIDIO_MONETARIO_ADMINISTRADOR_SUBSIDIO_WEB')
AND vapValidacion IN ('VALIDACION_PERSONA_CONYUGE_ACTIVO','VALIDACION_PERSONA_PENSIONADO_ACTIVO','VALIDACION_PERSONA_INDEPENDIENTE_ACTIVO')
AND vapObjetoValidacion = 'TRABAJADOR_DEPENDIENTE';

DELETE FROM ValidacionProceso
WHERE vapBloque IN ('CAMBIO_DATOS_DE_CUENTA_TRABAJADOR_DEPENDIENTE_PRESENCIAL','CAMBIO_DATOS_DE_CUENTA_TRABAJADOR_DEPENDIENTE_WEB','CAMBIO_DATOS_DE_CUENTA_TRABAJADOR_DEPENDIENTE_DEPWEB')
AND vapValidacion IN ('VALIDACION_PERSONA_CONYUGE_ACTIVO','VALIDACION_PERSONA_PENSIONADO_ACTIVO')
AND vapObjetoValidacion = 'TRABAJADOR_DEPENDIENTE';

